import { VscChromeClose } from "react-icons/vsc";

import './BookList.css';

function BookList({books,handleClick}){
    return(
        <>
        <ul className="list">
            {books.map(book =>(
                <li key={book.id} style={{gap:"20px"}}>{book.title}
                <VscChromeClose style={{ color: 'red', fontSize: '18px', fontWeight: 'bolder',bottom:'5px'}} 
                onClick={()=>handleClick(book.id)}/></li>
            ))}
        </ul>
        </>

    );
}
export default BookList;
